import React, {useState}from "react";
import "../styles/Watchlist.css";
import Navbar from "./NavBar";
import axios from 'axios';


function Watchlist() {

    const [searchTerm, setSearchTerm] = useState('');

    function handleInputChange(event) {
        setSearchTerm(event.target.value);
      }

      function handleSearch(event) {
        event.preventDefault();
        let formfield = new FormData()
        formfield.append('tickername',searchTerm)
        // TODO: Perform search using searchTerm
        axios.post('http://localhost:8000/watchlist/',searchTerm)
        console.log(`Performing search for "${searchTerm}"...`);
      }



    return(
        <>
        <div className="watchlist">
            <Navbar/>
        </div>
        <div>
      <form onSubmit={handleSearch}>
        <input type="text" placeholder="Search..." value={searchTerm} onChange={handleInputChange} />
        <button type="submit">Search</button>
      </form>
    </div>
        </>
    );
}

export default Watchlist;
